import "./Head.scss";

function Head() {
    return (
    <div className="head">
        <div className="head-in"></div>
        <div className="head-in2"><b>Moblie Phone Shop</b></div>
        <div className="head-in3"></div> 
    </div>
    );
  }

  export default Head;
